css:
@-moz-document domain("blackgate.com") {


html, body { font-size: 18px !important; }
html body * { font-size: 1em !important; line-height: 1.5 !important; }

html, body, #art, #content, #left, html body .post, #sidebartext, #left *, #commentlist, #commentlist * { background-color: #efefef !important; font-family: 'Open Sans', 'Segoe UI', sans-serif !important; }
html, body, #art, #content, #left, #sidebartext, blockquote, p, #left *, #commentlist, #commentlist * { color: #222222 !important; }
blockquote, blockquote p, #commentlist li.alt, #commentlist li.alt * { background-color: #fefefe !important; }
blockquote { margin: 1em 0 !important; padding: 1em !important;   }
blockquote p { border: 0px none #fefefe !important; }

html body b, html body strong { font-weight: 600 !important; }

html body .footer { background-color: #000000 !important; width: 100% !important; clear: both !important; margin: 0 !important; }
#content { padding: 0 !important; }
.post { padding: 1em 4em 2em 2em !important; margin: 0 !important; position: relative !important; z-index: 999 !important; border-left: 1px solid #000000 !important; }
#comments { padding-left: 1em !important; }
#commentlist { margin: 0 2.8em 0 -10px !important; }
img.sidebar { border: 11px solid #000000 !important; }

#left { width: 240px !important; border-right: 1px solid #000000 !important; border-bottom: 1px solid #000000 !important; }

#search { width: 180px !important;  }

#search #s { width: 120px !important; }

#sidebartext br+br { display: none !important; }
#sidebartext a { display: inline-block !important; margin: 0.5em 0 !important; }

#sidebartext a { display: none !important; }
#sidebartext a[href^="https://www.blackgate.com"] { display: inline-block !important;  }
#sidebartext a[href^="/"] { display: inline-block !important; }
#sidebartext a[href^="#"] { display: inline-block !important; }
#sidebartext a[href^="http://www.blackgate.net"] { display: inline-block !important; }

h1, h2, h3, h4, h5, h6, h1 a, h2 a, h3 a, h4 a, h5 a, h6 a { color: #B81ED4 !important; font-family: 'Open Sans', 'Segoe UI', sans-serif !important; font-weight: 800 !important; }

html body h1 { font-size: 2em !important; }
html body h2 { font-size: 1.8em !important; }
html body h3 { font-size: 1.6em !important; }
html body h4 { font-size: 1.4em !important; }
html body h5 { font-size: 1.2em !important; }
html body h6 { font-size: 1em !important; }

a { color: #1C729E !important; }
a:hover, a:visited { color: #777777 !important; }
h1 a:visited, h2 a:visited, h3 a:visited, h4 a:visited, h5 a:visited, h6 a:visited { color: #B81ED4 !important; }

#commentlist li { border: 1px solid #aaaaaa !important; border-top: 0px none #ffffff !important; padding: 1em 1em 0 1em !important; }
#commentlist li .commentmeta { border-top: 1px dotted #cccccc !important; text-align: right !important; color: #777 !important; }
#commentlist li:first-child {  border-top: 1px solid #aaaaaa !important; }
#commentlist li .commentmeta a { color: #1C729E !important; } 
#commentlist li blockquote { padding: 0 0.5em !important; border: 0px none #ffffff !important; margin: 1em 2em !important; }
html body #content #commentlist li blockquote, html body #content #commentlist li blockquote p { background-color: #e3e3e3 !important;
font-style: italic !important; }


html body #art { background-image: none !important; }
html body #head { height: 370px !important; margin-bottom: -100px !important; 
    background-color: #000000 !important; background-repeat: no-repeat !important; background-position: top left !important;
    background-image: url('data:image/jpeg;base64,') !important;  }

}
